### Main TriplesMap
####################
<http://en.dbpedia.org/resource/Mapping_en:Infobox_Australian_place>
        a                      rr:TriplesMap ;
        rml:logicalSource      <LogicalSource> ;
        rr:predicateObjectMap  <ConditionalMapping/0/Condition/0/StartDateMapping/0> ,
			       <ConditionalMapping/0/Condition/0/ClassMapping> ;
        rr:subjectMap          <SubjectMap> .


### Main SubjectMap
####################
<SubjectMap>  a      rr:SubjectMap ;
        rr:template  "http://en.dbpedia.org/resource/{wikititle}" ;
        rr:termType  rr:IRI .


### LogicalSource
##################

<LogicalSource>  a                rml:LogicalSource ;
        rml:iterator              "Infobox:Mapping_en:Infobox_Australian_place" ;
        rml:referenceFormulation  ql:wikitext .


